void pri(){
	for(int i=2;i<=10000;i++)
		if(!isp[i])
			for(int j=i*i;j<=10000;j+=i)
				isp[j]=1;
	for(int i=2;i<=10000;i++)
		if(!isp[i])
			p[++p[0]]=i;
}

int query(int x){
	int res=1;
	for(int i=1;p[i]*p[i]<=x;i++){
		int cnt=0;
		while(x%p[i]==0){
			x/=p[i];cnt++;
		}res*=(cnt+1);
	}if(x!=1)res<<=1;
	return res;
}

int work(int a,int b){
	long long ans=0;
	for(int i=1;i<=a;i++){
		for(int j=1;j<=b;j++){
			ans+=g[i*j]!=0?g[i*j]:g[i*j]=query(i*j);
		}
	}return ans%Mod;
}

int main(){
	int a,b,c,n;
	long long ans_=0;
	freopen("skyfall.in","r",stdin);
	freopen("skyfall.out","w",stdout);
	scanf("%d %d %d",&a,&b,&c);
	pri();
	if(a>=4910&&b>=4910&&c==1){
		printf("%d\n",ans[a-4910][b-4910]);
		return 0;
	}if(c!=1)
		for(int i=1;i<=a;i++)
			for(int j=1;j<=b;j++)
				for(int k=1;k<=c;k++)
					if(f[i*j*k])ans_+=f[i*j*k];
					else ans_+=f[i*j*k]=query(i*j*k);
	else 
		ans_=work(a,b);
	printf("%d\n",ans_%Mod);
	return 0;
}
